 Master Services Agreement govern and\n\t\t\t\t\t\tthe terms in this Agreement do not apply to Account Holder.\n\t\t\t\t\t</span></span></p>\n\n\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>&nbsp;</span></span></p>\n\n\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>1. ACCOUNT ACCEPTANCE AND AUTHORIZED SERVICES</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<br>\n\t\t\t\t\t<b>1.1 Appointment</b>. Account Holder hereby appoints and authorizes Prime Trust to provide the Services\n\t\t\t\t\tin accordance with this Agreement, and Prime Trust hereby accepts such appointment subject to the Account\n\t\t\t\t\tacceptance process in accordance with <b><u>Section 2.1</u></b> below.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(a) The services that Prime Trust will provide include the Fiat Services, On-Chain Services, and any other services,\n\t\t\t\t\tincluding the holding, processing, and acting as custodian of all Custodial Property, provided from time to time by\n\t\t\t\t\tPrime Trust to Account Holder in accordance with this Agreement (the <b>"Services"</b>). Without limiting the generality of\n\t\t\t\t\tthe foregoing, Prime Trust is authorized to collect into custody all Custodial Property while this Agreement is in\n\t\t\t\t\teffect (capitalized terms used in this sub-section are defined below).\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(b) In its sole discretion, Prime Trust may custody, on Account Holder\'s behalf, any property delivered by\n\t\t\t\t\tAccount Holder into the possession or control of Prime Trust (<b>"Custodial Property"</b>). For the avoidance of doubt,\n\t\t\t\t\tCustodial Property that Prime Trust may agree to accept and hold on Account Holder\'s behalf in accordance with this\n\t\t\t\t\tAgreement is limited to the following: (i) Digital Assets (defined below); (ii) Australian Dollars, Canadian Dollars,\n\t\t\t\t\tEuros, British Pounds, and Japanese Yen, and U.S. Dollars (<b>"USD"</b>), together with any other currencies made eligible\n\t\t\t\t\tfor Fiat Services, as determined by Prime Trust from time to time, (collectively, <b>"Fiat Currencies"</b>); (iii) title to\n\t\t\t\t\treal estate; (iv) private securities and public securities listed on any U.S. securities exchange or alternative\n\t\t\t\t\ttrading system; and (v) traditional and Roth individual retirement accounts (subject to applicable documentation\n\t\t\t\t\tin Prime Trust\'s sole discretion). Securities that have been issued in accordance with the regulations of countries\n\t\t\t\t\tother than the U.S. or which are listed on non-U.S. trading systems may be accepted for custody on a case-by-case basis\n\t\t\t\t\tupon approval by Prime Trust in its sole discretion.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(c) For the purposes of this Agreement, <b>"Digital Assets"</b> means Bitcoin and Ethereum, together with any other\n\t\t\t\t\tdigital representation of value that may function as a medium of exchange or medium for investment, and which\n\t\t\t\t\tis evidenced on and can be electronically received and stored using distributed ledger technology, as determined\n\t\t\t\t\tby Prime Trust from time to time\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>1.2 Provision of the Services.</span></b></p>\n<br>\n\n<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(a) Subject to Account Holder\'s completion of the Account acceptance process in accordance with\n\t\t\t\t\t<b><u>Section 2.1</u></b> and so long as Account Holder is in compliance with this Agreement,\n\t\t\t\t\tPrime Trust will provide the Services.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(b) In providing the Services, Prime Trust will act only upon receipt of any direction,\n\t\t\t\t\tinstruction, or request submitted by an Authorized Person (defined below) or through the\n\t\t\t\t\tAuthorized Integrator\'s platform (an <b>"Authorized Instruction"</b>). <b>"Authorized Integrator"</b> means a\n\t\t\t\t\tthird party that has: (i) entered into an agreement with the Account Holder to provide certain\n\t\t\t\t\tservices (<b>"Account Holder Service Provider Agreement"</b>); and (ii) entered into an agreement with\n\t\t\t\t\tPrime Trust to allow its customers to access the Services.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(c) Prime Trust, in its sole discretion, will determine whether the provision of the Services\n\t\t\t\t\tor an Authorized Instruction complies with all applicable U.S. federal, state, local, and foreign\n\t\t\t\t\tlaws, statutes, ordinances, regulations, rules, executive orders, circulars, opinions, agency guidance,\n\t\t\t\t\tinterpretive letters, and other official releases or requests of or by any government, or any authority,\n\t\t\t\t\tdepartment or agency thereof(<b>"Applicable Law"</b>) and may decline any Authorized Instruction, including if:\n\t\t\t\t\t(i) Account Holder is not in compliance with this Agreement; (ii) such Authorized Instruction may violate\n\t\t\t\t\tApplicable Law; or (iii) Account Holder has insufficient unencumbered, cleared Custodial Property in the\n\t\t\t\t\tAccount available for executing such Authorized Instruction.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(d) Prime Trust is entitled to rely upon any information, data, and documents provided in connection with the Services.\n\t\t\t\t\tAccount Holder acknowledges that Prime Trust has no duty to detect errors, or inquire into or investigate the legality,\n\t\t\t\t\tvalidity, completeness, or accuracy of any information, data, or documents provided to Prime Trust in connection with the Services.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(e) Prime Trust is entitled to rely upon any Authorized Instruction provided in connection with the Services and Account\n\t\t\t\t\tHolder acknowledges that Prime Trust has no duty to detect errors, or inquire into or investigate the legality, validity,\n\t\t\t\t\tcompleteness, or accuracy of any Authorized Instruction. Prime Trust will only act upon an Authorized Instruction and is\n\t\t\t\t\treleased and held harmless by Account Holder for acting upon the Authorized Instruction, including acting upon conflicting,\n\t\t\t\t\tsuperseded, or otherwise varying Authorized Instructions from multiple Authorized Persons.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(f) Account Holder acknowledges that Prime Trust will not monitor Digital Assets for actions taken by the issuer of such\n\t\t\t\t\tDigital Asset, if any. Such actions may include an issuer instruction requiring the holder of a Digital Asset to transfer\n\t\t\t\t\tit to a certain location. For the avoidance of doubt, Account Holder is solely responsible for satisfying or responding\n\t\t\t\t\tto any such actions of an issuer.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(g) Prime Trust will collect and hold all funds when Custodial Property may mature, be redeemed, or sold. Prime Trust\n\t\t\t\t\twill hold the proceeds of such transaction(s) until receipt of an Authorized Instruction.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(h) Funds received in any currency other than USD may, pursuant to an Authorized Instruction or as needed for Prime\n\t\t\t\t\tTrust to carry out an Authorized Instruction or pay Fees (defined below), be converted to USD at exchange rates\n\t\t\t\t\tset in Prime Trust\'s sole discretion.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal">\n\t\t\t\t<span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t\t(i) Prime Trust shall process the investment and reinvestment of Custodial Property in accordance with\n\t\t\t\t\tAuthorized Instructions only so long as, in the sole discretion of Prime Trust, such requested investments will\n\t\t\t\t\tnot impose an unreasonable administrative burden on Prime Trust (which such determination by Prime Trust\n\t\t\t\t\tshall not to be construed in any respect as a judgment concerning the prudence or advisability of such\n\t\t\t\t\tinvestment).\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>1.3 Storage of Digital Assets.</b>. Prime Trust will receive Digital Assets for storage by generating Private\n\t\t\t\t\tKeys and their Public Key pairs, with Prime Trust retaining custody of such Private Keys. <b>"Private Key"</b>\n\t\t\t\t\tmeans an alphanumeric string known only to the holder of a Digital Asset, which must be used to transact the\n\t\t\t\t\tDigital Asset represented by the corresponding Public Key. <b>"Public Key"</b> means an alphanumeric string on a\n\t\t\t\t\tBlockchain that indicates ownership/possession of a specific amount of a Digital Asset by a specific network\n\t\t\t\t\tparticipant and is visible to all participants in a Blockchain\'s network. Upon receipt, Prime Trust will custody\n\t\t\t\t\tthe Digital Assets in Account Holder\'s name or Accounts established for the benefit of Account Holder,\n\t\t\t\t\tunless otherwise specified in an Authorized Instruction. Prime Trust will be deemed to have received a\n\t\t\t\t\tDigital Asset after the Digital Asset\'s receipt has been confirmed on the relevant Blockchain or otherwise\n\t\t\t\t\tledgered to Prime Trust\'s satisfaction. <b>"Blockchain"</b> means a software operating a distributed ledger which is\n\t\t\t\t\tmaintained by a network of computers, and that records all transactions in a Digital Asset in theoretically\n\t\t\t\t\tunchangeable data packages known as blocks, each of which are timestamped to reference the previous block\n\t\t\t\t\tso that the blocks are linked in a chain that evidences the entire history of transactions in the Digital Asset.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t\t<b>1.4 Forks, Airdrops</b>.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t(a) For the purposes of this Agreement, <b>"Fork"</b> means: (i) that a Digital Asset network has been changed in a\n\t\t\t\t\tway that makes it incompatible with the unchanged version of the Digital Asset network; (ii) the changes\n\t\t\t\t\thave been widely accepted by users of the Digital Asset network; and (iii) that the two resulting Digital Asset\n\t\t\t\t\tnetworks have not been merged together at the time of any action to be taken by Prime Trust. A Fork may\n\t\t\t\t\tcreate two separate Digital Asset networks (each, a <b>"Forked Network"</b>), and may result in Prime Trust\n\t\t\t\t\tholding an identical amount of Digital Assets associated with each Forked Network.\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\t\t\t\t\t(b) Should a Fork occur: (i) Prime Trust retains the right, in its sole discretion, to determine whether or not to\n\t\t\t\t\tsupport either Forked Network; (ii) in connection with determining to support or not to support a Forked\n\t\t\t\t\tNetwork, Prime Trust may suspend certain operations, in whole or in part (with or without advance notice),\n\t\t\t\t\tfor however long Prime Trust deems reasonably necessary, in order to take the necessary steps, as determined\n\t\t\t\t\tin its sole discretion, to perform obligations hereunder with respect to supporting or not supporting a Forked\n\t\t\t\t\tNetwork; (iii) Account Holder hereby agrees that Prime Trust will determine, in its sole discretion, whether\n\t\t\t\t\tor not to support such Forked Network and that Account Holder will have no right or claim against Prime\n\t\t\t\t\tTrust related to value represented by any change in the value of any Digital Asset (whether on a Forked\n\t\t\t\t\tNetwork or otherwise), including with respect to any period of time during which Prime Trust exercises its\n\t\t\t\t\trights described herein with respect to Forks and Forked Networks; (iv) Prime Trust will select, in its sole\n\t\t\t\t\tdiscretion, at least one of the Forked Networks to support and will identify such selection in a notice; (v) with\n\t\t\t\t\trespect to a Forked Network that Prime Trust chooses not to support, it may, in its sole discretion, elect to (A)\n\t\t\t\t\tabandon or otherwise not pursue obtaining the Digital Assets from that Forked Network, or (B) deliver the\n\t\t\t\t\tDigital Assets from that Forked Network to Account Holder within a time period as determined by Prime\n\t\t\t\t\tTrust in its sole discretion, together with any credentials, keys, or other information sufficient to gain control\n\t\t\t\t\tover such Digital Assets (subject to the withholding and retention by Prime Trust of any amount reasonably\n\t\t\t\t\tnecessary, as determined in Prime Trust\'s sole discretion, to fairly compensate Prime Trust for the efforts\n\t\t\t\t\texpended to obtain and deliver such Digital Assets to Account Holder); (vi) with respect to Forked Networks\n\t\t\t\t\tthat Prime Trust chooses to support, Account Holder may be responsible for Fees to be negotiated; and (vii)\n\t\t\t\t\tAccount Holder acknowledges and agrees that Prime Trust assumes no responsibility or obligations with\n\t\t\t\t\trespect to any Forked Network and related Digital Assets that it chooses not to support.\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\t\t\t\t\t(c) In the event that a Digital Asset network attempts to or does contribute (sometimes called "airdropping"\n\t\t\t\t\tor "bootstrapping") its Digital Assets (collectively, "<b>Airdropped Digital Assets</b>") to holders of Digital\n\t\t\t\t\tAssets on an existing Digital Asset network and Account Holder notifies Prime Trust in writing of such\n\t\t\t\t\tevent, Prime Trust may, in its sole discretion, elect to: (i) subject to an airdrop fee to be determined, support\n\t\t\t\t\tthe Airdropped Digital Asset for Custody and, if appropriate, reconcile Account; (ii) abandon or otherwise\n\t\t\t\t\tnot pursue obtaining the Airdropped Digital Asset; or (iii) deliver the Airdropped Digital Assets from that\n\t\t\t\t\tDigital Asset network to Account Holder within a time period as determined by Prime Trust in its sole\n\t\t\t\t\tdiscretion, together with any credentials, keys, or other information sufficient to gain control over such\n\t\t\t\t\tAirdropped Digital Assets (subject to the withholding and retention by Prime Trust of any amount reasonably\n\t\t\t\t\tnecessary, as determined in Prime Trust\'s sole discretion, to fairly compensate Prime Trust for the efforts\n\t\t\t\t\texpended to obtain and deliver such Airdropped Digital Assets to Account Holder). Airdropped Digital\n\t\t\t\t\tAssets do not create any relationship between the sender and/or Digital Asset network and Prime Trust and\n\t\t\t\t\tdo not subject Prime Trust to any responsibilities or obligations as it relates to the sender and/or Digital Asset\n\t\t\t\t\tnetwork.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>1.5 On-Chain Services</b>. Subject to any documentation requested by Prime Trust in its sole discretion, from\n\t\t\t\t\ttime to time, Prime Trust may offer Account Holder additional Services involving on-chain transactions\n\t\t\t\t\t(other than deposits and withdrawals included in Prime Trust\'s basic custody Service), which may include\n\t\t\t\t\tstaking, voting, inflation, signaling, and other activities requiring interaction with the applicable Blockchain\n\t\t\t\t\t<b>("On-Chain Services")</b>. Account Holder may be required to accept additional terms as a condition to\n\t\t\t\t\treceiving any On-Chain Services. Prime Trust may discontinue an On-Chain Service at any time without\n\t\t\t\t\tnotice for any reason. If Prime Trust decides to discontinue an On-Chain Service, Prime Trust will endeavor\n\t\t\t\t\tto provide as much notice to Account Holder as reasonably possible.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>1.6 Fiat Currency Instructions and Acknowledgements; Disclosures.</b>. Prime Trust may, in its sole\n\t\t\t\t\tdiscretion, offer the custody of Fiat Currencies and foreign exchange transactions in Fiat Currencies\n\t\t\t\t\t(<b>"Fiat Services"</b>) to Account Holder. If Prime Trust offers Fiat Services, and Account Holder accepts Fiat Services,\n\t\t\t\t\tPrime Trust may:\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t(a) subject to <u>Section 1.6(b)</u>, deposit any cash or Fiat Currency funds deposited by Account Holder with\n\t\t\t\t\tPrime Trust, for which Account Holder has not already provided transfer instructions, into deposit\n\t\t\t\t\taccounts at Federal Deposit Insurance Corporation (<b>"FDIC"</b>)-insured, regulated depository institutions\n\t\t\t\t\tselected by Prime Trust, which accounts will be held for the benefit of Prime Trust Account Holders\n\t\t\t\t\t(<b>"Deposit Accounts"</b>) and maintain the Deposit Accounts as omnibus accounts, which will not be segregated\n\t\t\t\t\tby Account Holder; enter into such sub-accounting agreements as may be required by the depository\n\t\t\t\t\tinstitution; and initiate wire or other transfer requests from time to time for the withdrawal of Account\n\t\t\t\t\tHolder funds from the Deposit Accounts, which requests are to be honored by the depository institution for\n\t\t\t\t\twithdrawal of Account Holder\'s funds from such Deposit Accounts for distributions, investments, Fees, and\n\t\t\t\t\tother disbursements pursuant to an Authorized Instruction. All applicable wire or other transfer Fees will be\n\t\t\t\t\tpaid by Account Holder.\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\t\t\t\t\t(b) otherwise use or invest such cash or Fiat Currency at Prime Trust\'s own risk. Without limiting the\n\t\t\t\t\tforegoing, Prime Trust may use such Fiat Currency to purchase securities or other assets that it may hold and\n\t\t\t\t\tregister in its own name or in the name of its nominee and pledge, repledge, hypothecate, rehypothecate, sell,\n\t\t\t\t\tor otherwise transfer or use any amount of such securities or other assets with all attendant rights of\n\t\t\t\t\townership and without any obligation to maintain in its possession or control a like amount of cash or Fiat\n\t\t\t\t\tCurrency, subject to Prime Trust\'s obligation to return Fiat Currency to Account Holder in accordance with\n\t\t\t\t\tthis Agreement. Prime Trust may receive earnings or compensation for an omnibus account either in the form\n\t\t\t\t\tof services provided at a reduced rate, the payment of any shareholder service fees, or similar compensation,\n\t\t\t\t\tand Prime Trust may receive earnings or income from using or investing cash or Fiat Currency as described\n\t\t\t\t\therein. Account Holder agrees that any such earnings, income or compensation shall be retained by Prime\n\t\t\t\t\tTrust and no portion of any such earning, income or compensation shall be paid to or for Account Holder.\n\t\t\t\t\tAccount Holder acknowledges and agrees that Prime Trust may hold some or any portion of Fiat Currency in\n\t\t\t\t\taccounts, including but not limited to money market deposit accounts, that may or may not receive interest or\n\t\t\t\t\tearnings attributable to such Fiat Currency. Account Holder hereby agrees that the amount of such interest or\n\t\t\t\t\tearnings attributable to Fiat Currency may be retained by Prime Trust as additional consideration for its\n\t\t\t\t\tservices\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\n\t\t\t\t\t(c) Prime Trust will keep records for the purpose of obtaining pass-through FDIC insurance with respect to\n\t\t\t\t\tany sub-account held for the Account Holder that is part of the Custodial Property held in Deposit Accounts\n\t\t\t\t\tby Prime Trust to the extent provided by Applicable Law. Account Holder acknowledges and accepts that\n\t\t\t\t\tPrime Trust does not guarantee that pass-through FDIC coverage will be available for any such sub-account.\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\n\t\t\t\t\t(d) if Account Holder elects to provide a card payment method to transfer funds into the Account, Account\n\t\t\t\t\tHolder hereby authorizes Prime Trust to debit the card payment method for the purpose of transferring the\n\t\t\t\t\tfunds. Further, Account Holder hereby authorizes Prime Trust to store and file the card payment method and\n\t\t\t\t\tcharge the card payment method on file in connection with any future transfers of funds by the Account\n\t\t\t\t\tHolder.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>1.7 Limitations on Services</b>. Account Holder agrees that Prime Trust will only perform the Services, and\n\t\t\t\t\tno additional duties or obligations will be implied. In particular, Prime Trust will not exercise any legal,\n\t\t\t\t\tinvestment, tax, or accounting planning, advice, discretion, or recommendation whatsoever regarding your\n\t\t\t\t\tAccount. In providing the Services, Prime Trust has no duty to inquire as to the provisions of or application\n\t\t\t\t\tof any agreement or document other than this Agreement, notwithstanding Prime Trust\'s receipt of such\n\t\t\t\t\tagreement or document.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>1.8 Ownership of Custodial Property</b>. Account Holder owns all Custodial Property held by Prime Trust\n\t\t\t\t\ton behalf of Account Holder in accordance with this Agreement. Account Holder\'s Custodial Property will\n\t\t\t\t\tnot be reflected on Prime Trust\'s balance sheet as assets of Prime Trust. Prime Trust may, for convenience,\n\t\t\t\t\ttake and hold title to Custodial Property or any part thereof in its own name with Account Holder\'s\n\t\t\t\t\townership of Custodial Property segregated on Prime Trust\'s books and records.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>2. ACCOUNT ACCEPTANCE; AUTHORIZED PERSONS</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<br>\n\t\t\t\t\t<b>2.1 Account Acceptance</b>. Services will be provided only upon the date of Account Holder\'s successful\n\t\t\t\t\tcompletion of the Account acceptance process (the <b>"Effective Date"</b>), as determined in Prime Trust\'s sole\n\t\t\t\t\tdiscretion and in accordance with this <b><u>Section 2.1</u></b>. To complete the acceptance process, Account Holder will\n\t\t\t\t\tprovide Prime Trust with information and documents, which includes information necessary for Prime\n\t\t\t\t\tTrust\'s compliance with the Bank Secrecy Act (<b>"BSA"</b>), and other Applicable Law relating to anti-money\n\t\t\t\t\tlaundering (<b>"AML"</b>), Know-Your-Customer (<b>"KYC"</b>), counter-terrorist financing, sanctions screening\n\t\t\t\t\trequirements, or any other similar legal obligations, in each case, as determined by Prime Trust in its sole\n\t\t\t\t\tdiscretion.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>2.2 Authorized Persons</b>.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t(a) Upon acceptance of Account Holder as determined by Prime Trust, Account Holder will designate to\n\t\t\t\t\tPrime Trust one or more persons authorized to provide instructions with respect to the Account (each, an\n\t\t\t\t\t<b>"Authorized Person"</b>). Account Holder is solely responsible for designating to Prime Trust all Authorized\n\t\t\t\t\tPersons, for advising Prime Trust of the removal of any Authorized Persons, and for all actions of Authorized\n\t\t\t\t\tPersons.\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\t\t\t\t\t(b) Account Holder shall notify Prime Trust of the termination of any Account Holder Service Provider\n\t\t\t\t\tAgreement, and Prime Trust will not be liable for acting on any instruction sent by any person with whom\n\t\t\t\t\tAccount Holder no longer maintains an Account Holder Service Provider Agreement.\n\t\t\t\t\t<br>\n\t\t\t\t\t<br>\n\t\t\t\t\t(c) You agree that Prime Trust may rely on an Authorized Person\'s email address currently on file with Prime\n\t\t\t\t\tTrust for the purposes of acting on an Authorized Instruction from an Authorized Person.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>2.3 Joint Accounts</b>. In the case of a joint Account, each person with an interest in the Account, who is a\n\t\t\t\t\tParty to this Agreement, is considered an Account Holder. The obligations and agreements applicable to each\n\t\t\t\t\tpart to a joint Account under this Agreement shall be deemed to be joint and several.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>2.4 Acknowledgements</b>. Account Holder acknowledges that:\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(a) Account Holder is an "Entitlement Holder" in a "Financial Asset," as defined by, and for purposes of, the\n\t\t\t\t\tUniform Commercial Code, including Article 8 thereto, as adopted and implemented in accordance with\n\t\t\t\t\tNevada law (<b>"UCC"</b>). Applicable Custodial Property are "Financial Assets" for purposes of the UCC and are\n\t\t\t\t\tnot assets of Prime Trust.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(b) Account Holder is solely responsible for, and Prime Trust has no involvement in, determining whether\n\t\t\t\t\tany investment, investment strategy, or related transaction is appropriate for Account Holder. Prime Trust\n\t\t\t\t\twill have no duty or responsibility to review or perform due diligence on any investments or transactions and\n\t\t\t\t\twill make no recommendation of investments or transactions, nor supervise any such investments or\n\t\t\t\t\ttransactions. You will perform your own due diligence on all investments and take sole responsibility for all\n\t\t\t\t\tdecisions made for your Account.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(c) Prime Trust does not provide any valuation or appraisals of Custodial Property, nor does it hire or seek\n\t\t\t\t\tvaluations or appraisals on any Custodial Property; <u>provided</u>, <u>however</u>, that Prime Trust may, at its option\n\t\t\t\t\tand with no obligation or liability, to the extent reasonably available for any particular asset, make available\n\t\t\t\t\trecent price quotes or value estimates from various third-party sources, including stock exchanges and\n\t\t\t\t\talternative trading systems registered with the Securities and Exchange Commission, digital asset exchanges,\n\t\t\t\t\tand real estate websites. Prime Trust will not attempt to verify the validity, accuracy or reliability of any such\n\t\t\t\t\tthird-party valuation, valuation estimates or price quotes (collectively, <b>"Valuation Data"</b>) and you agree that\n\t\t\t\t\tPrime Trust will have no liability in connection with any such Valuation Data, including for any unreliable,\n\t\t\t\t\tinaccurate, or misleading information. Any Valuation Data provided to you is furnished for general\n\t\t\t\t\tinformation purposes only, and should not be relied upon as a definitive determination of the market value of\n\t\t\t\t\tany Custodial Property, nor should such Valuation Data be used for tax reporting purposes. You understand\n\t\t\t\t\tand agree that you should engage an independent financial advisor, appraiser, or valuation firm in order to\n\t\t\t\t\tobtain a formal opinion or financial advice regarding the value of any Custodial Property.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(d) Prime Trust has no control over, and is not responsible or liable for, any services or technology supporting\n\t\t\t\t\tor used in connection with any Custodial Property, Service Provider, Authorized Integrator platform, or the\n\t\t\t\t\tmarkets in which Custodial Property is purchased, sold or otherwise traded, and any Custodial Property,\n\t\t\t\t\tService Provider (defined below), Authorized Integrator platform or such markets, and any such services or\n\t\t\t\t\ttechnology, may be susceptible to, or limited or compromised by, errors, technology flaws or defects, viruses\n\t\t\t\t\tor other malicious code, manipulations, hacks, other attacks, outages, and other interruptions and limitations.\n\t\t\t\t\tFor the purposes of this Agreement, <b>"Service Provider"</b> means any unaffiliated third-party entity retained by\n\t\t\t\t\tPrime Trust to provide any of the Services on behalf of Prime Trust to the Account Holder.\n\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(e) The custody of Digital Assets is generally subject to a high degree of risk, and the nature of Digital Assets\n\t\t\t\t\tmay lead to an increased risk of technology flaws, fraud or attacks.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(f) Prime Trust does not control and makes no guarantee as to the functionality of any Blockchain\'s\n\t\t\t\t\tdecentralized governance, which could, among other things, lead to delays, conflicts of interest, or\n\t\t\t\t\toperational decisions that may impact Account Holder and/or its Custodial Property.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(g) Advancements in cryptography could render current cryptography algorithms utilized by a Blockchain\n\t\t\t\t\tsupporting a specific Digital Asset inoperative.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(h) The supply of Digital Assets available as a result of a Forked Network and Prime Trust\'s ability to deliver\n\t\t\t\t\tDigital Assets resulting from a Forked Network may depend on Service Providers and other third-party\n\t\t\t\t\tproviders that are outside Prime Trust\'s control. Prime Trust does not own or control any of the protocols that\n\t\t\t\t\tare used in connection with Digital Assets and their related Digital Asset networks, including those resulting\n\t\t\t\t\tfrom a Forked Network. Accordingly, Prime Trust disclaims all liability relating to such protocols and any\n\t\t\t\t\tchange in the value of any Digital Assets (whether on a Forked Network or otherwise), and makes no\n\t\t\t\t\tguarantees regarding the security, functionality, or availability of such protocols or Digital Asset networks.\n\t\t\t\t\tAccount Holder accepts all risks associated with the use of the Services to conduct transactions.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(i) The price and liquidity of Digital Assets have fluctuated substantially in the past and may fluctuate\n\t\t\t\t\tsubstantially in the future, and such fluctuation may affect the value of your Account, including a total loss of\n\t\t\t\t\tthe value of Digital Assets. The value of your Account will be solely dependent upon the performance of\n\t\t\t\t\tCustodial Property.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(j) Digital Assets held in Accounts are not entitled to deposit insurance protection by the FDIC. Assets held\n\t\t\t\t\tin Accounts are not insured by Prime Trust insurance policies and are not entitled to protection afforded to\n\t\t\t\t\tcustomers under the Securities Investor Protection Act of 1970, as amended.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(k) Subject to Applicable Law, Digital Assets are not legal tender and are not backed by any government.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(l) Changes in Applicable Law may adversely affect the use, transfer, exchange, and value of Custodial\n\t\t\t\t\tProperty.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(m) Transactions in Custodial Property may be irreversible, and, accordingly, losses due to fraudulent or\n\t\t\t\t\taccidental transactions may not be recoverable.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(n) Some Digital Asset transactions will be deemed to be made when recorded on a public ledger, which is\n\t\t\t\t\tnot necessarily the date or time that the transaction was initiated.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(o) The value of Digital Assets may be derived from the continued willingness of market participants to\n\t\t\t\t\texchange Fiat Currencies or Digital Assets for Digital Assets, which may result in the potential for\n\t\t\t\t\tpermanent and total loss of value of a particular Digital Asset should the market for that Digital Asset\n\t\t\t\t\tdisappear.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(p) There is no assurance that a person who accepts Digital Assets as payment today will continue to do so in\n\t\t\t\t\tthe future.\n\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(q) Due to the volatility and unpredictability of the price of Digital Assets relative to Fiat Currencies, trading\n\t\t\t\t\tand owning Digital Assets may result in significant loss over a short period of time.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(r) The nature of Digital Assets means that technological difficulties experienced by Prime Trust may prevent\n\t\t\t\t\tthe access to or use of Account Holder\'s Digital Assets. In addition, access to or transfers of Digital Assets\n\t\t\t\t\tmay be delayed due to security protocols, time-zone differences, communication technology delays or fails,\n\t\t\t\t\tand/or enhanced internal compliance reviews.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(s) All instructions for the purchase and sale of securities and/or Digital Assets will be executed through one\n\t\t\t\t\tor more broker-dealers or exchanges selected by either you or another Authorized Person, or by Prime Trust,\n\t\t\t\t\tas an accommodation (and not in any capacity as a broker-dealer), and Prime Trust is hereby authorized to\n\t\t\t\t\tdebit your account for any Fees associated with such transaction(s) and remit those to the executing party.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(t) With respect to Custodial Assets that are not securities, Account Holder acknowledges and agrees that: (i)\n\t\t\t\t\tPrime Trust does not have access to every market or exchange which a particular product or financial\n\t\t\t\t\tinstrument may be traded and Prime Trust makes no representation regarding the best price execution of any\n\t\t\t\t\tinstructions; (ii) other orders may trade ahead of Account Holder\'s order and exhaust available volume at a\n\t\t\t\t\tposted price; (iii) exchanges, market makers or other types of sellers or purchasers may fail to honor posted\n\t\t\t\t\tor otherwise agreed-upon prices; (iv) exchanges may reroute customer orders out of automated execution\n\t\t\t\t\tsystems for manual handling (in which case, execution may be substantially delayed); (v) system delays by\n\t\t\t\t\texchanges or third parties executing instructions may prevent Account Holders order from being executed,\n\t\t\t\t\tmay cause a delay in execution or not to be executed at the best posted price or at all; and (vi) Prime Trust\n\t\t\t\t\tmay not promptly or in a timely manner execute Account Holder order(s) due to internal delays, and Prime\n\t\t\t\t\tTrust makes no representation that its Services are in any way suitable for active trading or any activity\n\t\t\t\t\trequiring prompt or exact execution. The Account is not a brokerage account. Transactions may be subject to\n\t\t\t\t\tadditional Fees and charges by Prime Trust or any Service Provider or exchange.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(u) As between you and Prime Trust, Prime Trust owns the Services and any improvements or modifications\n\t\t\t\t\tto the Services, and all intellectual property rights therein. All suggestions, comments, feedback, data\n\t\t\t\t\t(including metadata), insights, ideas or know-how, in any form, regarding the Service (including any of its\n\t\t\t\t\tfunctionality), including those derived from our monitoring and analysis of your use of the Service will be\n\t\t\t\t\tthe sole property of Prime Trust. To the extent you have or obtain any right, title or interest in such feedback,\n\t\t\t\t\tyou hereby assign to Prime Trust all right, title and interest to such feedback (including any intellectual\n\t\t\t\t\tproperty rights therein) and agree to perform such further acts as may be reasonably necessary to evidence\n\t\t\t\t\tsuch assignment.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t<br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>3. REPRESENTATIONS AND WARRANTIES</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<br>\n\t\t\t\t\t<b>3.1</b>. Account Holder represents, warrants, and covenants at all times while this Agreement is in effect:\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(a) if an entity, Account Holder is validly organized or formed, as applicable, and in good standing in\n\t\t\t\t\taccordance with Applicable Law and has all requisite authority to enter into this Agreement and perform its\n\t\t\t\t\tobligations hereunder;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(b) it has all rights, power, and, if an entity, authority necessary to enter into this Agreement and perform its\n\t\t\t\t\tobligations hereunder;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(c) its entry into, and performance of its obligations under, this Agreement, and Prime Trust\'s exercise of its\n\t\t\t\t\trights in accordance with this Agreement, will not conflict with, or result in a breach or violation of, any term\n\t\t\t\t\tor provision, or constitute a default under, any agreement by which it is bound or any Applicable Law;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(d) it will comply with all Applicable Law including the BSA and all other Applicable Laws related to AML,\n\t\t\t\t\tKYC, counter-terrorist financing, sanctions requirements, in performing its obligations in accordance with\n\t\t\t\t\tthis Agreement;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(e) it will: (i) fully satisfy Prime Trust\'s information requests and other requirements, including those relating\n\t\t\t\t\tto Authorized Persons or Custodial Property, and keep current any provided information; (ii) notify Prime\n\t\t\t\t\tTrust if the Account Holder becomes a target of any action, investigation or prosecution related to this\n\t\t\t\t\tAgreement, the Services, or Custodial Property; and (iii) provide Prime Trust full cooperation in connection\n\t\t\t\t\twith any inquiry or investigation of Prime Trust made or conducted by any U.S. federal or state authority.\n\t\t\t\t\tPrime Trust shall have no obligation to provide the Services if Account Holder or any Authorized Person(s)\n\t\t\t\t\tfail to comply with the foregoing to Prime Trust\'s satisfaction;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(f) the appointment of Prime Trust and the execution of the terms outlined in this Agreement by Account\n\t\t\t\t\tHolder will not violate any Applicable Law;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(g) Account Holder owns, and will at all times own, all Custodial Property, free and clear of all liens and\n\t\t\t\t\tencumbrances (other than those granted to Prime Trust in accordance with this Agreement or as otherwise\n\t\t\t\t\tcreated by applicable U.S. federal or state securities laws);\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(h) neither Account Holder nor any other Authorized Person is, nor is directly or indirectly owned or\n\t\t\t\t\tcontrolled by, any person or entity (i) included on the Specially Designated Nationals and Blocked Persons or\n\t\t\t\t\tthe Consolidated Sanctions List maintained by the Office of Foreign Assets Control of the U.S. Department\n\t\t\t\t\tof the Treasury (<b>"OFAC"</b>) or any similar list maintained by any government entity from time to time, or (ii)\n\t\t\t\t\tlocated, organized, or resident in a country or territory that is the target of sanctions imposed by OFAC or\n\t\t\t\t\tany government entity;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(i) Account Holder will not, and will not direct or permit its Authorized Persons to, direct the purchase, sale,\n\t\t\t\t\tor transfer of any Custodial Property which is (a) prohibited by Applicable Law, or (b) prohibited by Section\n\t\t\t\t\t4975 of the Internal Revenue Code;\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(j) if an individual, Account Holder is over the age of 18 and has all personal power or capacity to enter into\n\t\t\t\t\tthis Agreement and perform its obligations hereunder; and\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(k) that all information provided to Prime Trust in accordance with this Agreement is and will be complete,\n\t\t\t\t\tcorrect, current, and accurate in all respects. Account Holder will notify Prime Trust immediately in\n\t\t\t\t\taccordance with <u>Section 15.3</u> if any such information, including Account Holder\'s email address on file with\n\t\t\t\t\tPrime Trust, is no longer complete, correct, current, and accurate in all respects.\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>4. PRIVACY AND DATA POLICIES</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\tTo the extent permitted by Applicable Law and our privacy and data policies, Prime Trust may share\n\t\t\t\t\tinformation about you and your Account with affiliates and third parties. Account Holder agrees to Prime\n\t\t\t\t\tTrust\'s privacy and data policies, available at www.primetrust.com/privacy. Prime Trust may modify these\n\t\t\t\t\tpolicies at any time without prior notice of liability, and any modification will be effective following thirty\n\t\t\t\t\t(30) days after posting to Prime Trust\'s website.\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n<br>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>5. ELECTRONIC STATEMENTS</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>5.1 Account Statements.</b>. Account Holder agrees that Prime Trust will make current and prior Account\n\t\t\t\t\tstatements available in electronic form only. Account Holder further agrees to access statements on the\n\t\t\t\t\twebsites or applications of the Authorized Integrator. Account Holder understands and agrees that Prime\n\t\t\t\t\tTrust will not provide Account Holder hard-copy statements.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>5.2 Monitoring Your Account.</b>. As an Account Holder, you are responsible for monitoring your Account,\n\t\t\t\t\tincluding transaction confirmations and Account statements, and reviewing these documents to see that\n\t\t\t\t\tinformation about your Account is accurate. You agree to review your monthly statements and promptly\n\t\t\t\t\tnotify Prime Trust of any unusual or unauthorized activity. You remain responsible for monitoring your\n\t\t\t\t\tAccount and reconciling all balances, statements, and activity. You agree to notify Prime Trust immediately\n\t\t\t\t\tin accordance with <u>Section 15.3</u> if there is any type of discrepancy or suspicious or unexplained occurrence\n\t\t\t\t\trelating to your Account, including any unauthorized transaction. If you fail to notify Prime Trust\n\t\t\t\t\timmediately, no Indemnitee (defined below) will be liable for any consequences. If, through any error, you\n\t\t\t\t\thave received property that is not rightfully yours, you agree to notify Prime Trust and return the property\n\t\t\t\t\timmediately. If Prime Trust identifies an error in connection with property you have received from or\n\t\t\t\t\tthrough Prime Trust and determine it is not rightfully yours, you agree that Prime Trust may take action to\n\t\t\t\t\tcorrect the error, which may include returning such property to the rightful owner.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>6. AUTHORITY TO PLEDGE; RIGHT TO SET-OFF; LIEN</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t\t\tExcept as otherwise provided in this <u>Section 6</u>, Account Holder may not loan, hypothecate, pledge, or\n\t\t\t\t\totherwise encumber any Custodial Property. Account Holder grants Prime Trust a right of set-off against, and\n\t\t\t\t\tlien on and security interest in the Custodial Property for the payment of any Fees and any other amounts due\n\t\t\t\t\tto Prime Trust under and in accordance with this Agreement.\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>7. APPLICATION OF UCC</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t\t\tExcept as otherwise provided under Applicable Law, the Parties agree the relationship between Prime Trust\n\t\t\t\t\tand Account Holder is governed by Article 8 of the UCC and that for the purposes of this Agreement:\n\t\t\t\t\tAccount Holder is an "entitlement holder" and any Custodial Property will be treated as a "Financial Asset"\n\t\t\t\t\twithin the meaning of Nevada Revised Statutes (<b>"NRS"</b>) 104.8102(h) and (j).\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>8. BOOKS AND RECORDS</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t\t\tPrime Trust will record on its books and records (including records of receipts, disbursements, and other\n\t\t\t\t\ttransactions) all Custodial Property and will segregate Account Holder\'s Custodial Property from the\n\t\t\t\t\tCustodial Property of any other Account Holder, person, or entity, unless otherwise specified in an\n\t\t\t\t\tAuthorized Instruction. Prime Trust will hold such records in accordance with Applicable Law. Upon\n\t\t\t\t\tcommercially reasonable notice by Account Holder, Prime Trust will provide Account Holder copies of the\n\t\t\t\t\tbooks and records pertaining to Account Holder that are in the possession or under the control of Prime\n\t\t\t\t\tTrust.\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t</span></p>\n\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>9. FEES</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>9.1</b> Account Holder will pay Prime Trust the Fees, if any, in connection with the Services. "Fees" means\n\t\t\t\t\tany monthly custody fee for Custodial Property, statement fee, third-party fee, and all other applicable fees\n\t\t\t\t\tand other charges as made available on Prime Trust\'s website and as may be modified from time to time.\n\t\t\t\t\tChanges to Fees will not affect any Fees for prior periods and will only be effective as of the date changes\n\t\t\t\t\tare published on Prime Trust\'s website. All Fees are payable no later than thirty (30) days after the Fee is\n\t\t\t\t\tincurred.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>9.2</b> In the event that Prime Trust is charged any Fees (e.g., transfer agent fees, legal fees, accounting fees,\n\t\t\t\t\ttax preparation fees, notary fees, exchange fees, brokerage fees, bank fees, Blockchain settlement fees, etc.)\n\t\t\t\t\tby a third party in performing Services, Account Holder agrees to reimburse Prime Trust for such Fees at\n\t\t\t\t\tcost-plus 25% (excluding broker-dealer commissions).\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>10. TERM AND TERMINATION</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>10.1 Term</b>. This Agreement is effective as of the Effective Date, and will continue in full force and effect\n\t\t\t\t\tuntil terminated as provided herein (the <b>"Term"</b>).\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>10.2 Termination</b>. This Agreement may be terminated by either Party at any time upon thirty (30) days\'\n\t\t\t\t\tprior written notice to the other Party; <u>provided</u>, <u>however</u>, that Prime Trust may immediately terminate this\n\t\t\t\t\tAgreement without notice in the event that: (i) Prime Trust becomes aware or has reason to believe that\n\t\t\t\t\tAccount Holder may be engaged in illegal activity, has violated Applicable Law, or has breached its\n\t\t\t\t\tobligations under this Agreement; (ii) termination is deemed appropriate by Prime Trust to comply with\n\t\t\t\t\tApplicable Law; or (iii) Prime Trust terminates its agreement with an Authorized Integrator, in which case,\n\t\t\t\t\tPrime Trust, in its sole discretion, may choose to continue to provide Services to the Account Holder but will\n\t\t\t\t\tno longer accept Authorized Instructions using the Authorized Integrator platform under the terminated\n\t\t\t\t\tagreement.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>10.3 Termination of an Account Holder Service Provider Agreement</b>. In the event an Account Holder\n\t\t\t\t\tintends to terminate its Account Holder Service Provider Agreement, the Account Holder must provide thirty\n\t\t\t\t\t(30) days\' prior written notice to Prime Trust in accordance with <u>Section 15.3</u>, which notice shall include the\n\t\t\t\t\teffective date of termination. In the event of termination of the Account Holder Service Provider Agreement,\n\t\t\t\t\tPrime Trust will no longer accept Authorized Instructions using the Authorized Integrator platform.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>10.4 Effect of Termination</b>. Upon termination of this Agreement, Account Holder will pay Prime Trust all\n\t\t\t\t\tFees and any other amounts due and owing hereunder.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>10.5 Obligations and Rights upon Termination</b>.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(a) Return of Custodial Property. Upon termination of this Agreement, Account Holder will provide\n\t\t\t\t\tAuthorized Instructions regarding the disbursement of the Account Holder\'s Custodial Property and Prime\n\t\t\t\t\tTrust will, subject to Applicable Law, deliver Account Holder\'s Custodial Property in accordance with the\n\t\t\t\t\tAuthorized Instructions. A Digital Asset will be deemed to have been delivered to Account Holder when a\n\t\t\t\t\ttransfer of the Digital Asset initiated by Prime Trust has received a reasonable number of confirmations on\n\t\t\t\t\tthe relevant Blockchain, or an alternative method has been mutually agreed between Prime Trust and\n\t\t\t\t\tAccount Holder. To the extent Account Holder is unable to transfer Digital Assets out of the Account due to\n\t\t\t\t\tinsufficient gas or network fees necessary for the transfer, Account Holder agrees to and abandons and\n\t\t\t\t\tforfeits any claims to such Digital Assets upon closure of the Account. Upon termination of this Agreement,\n\t\t\t\t\tPrime Trust will deliver other Custodial Property to Account Holder as soon as practicable or, at Account\n\n\t\t\t\t\tHolder\'s request, to a successor custodian. Account Holder acknowledges that Custodial Property, if any,\n\t\t\t\t\theld in Prime Trust\'s name requires a reasonable amount of time to be delivered. Upon delivery of Custodial\n\t\t\t\t\tProperty, Prime Trust\'s responsibility under this Agreement ceases.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(b) Death or Incompetency of Account Holder. Upon the death or incompetency of Account Holder, Prime\n\t\t\t\t\tTrust will continue to hold Custodial Property until such time Prime Trust receives instructions from Account\n\t\t\t\t\tHolder\'s executor, trustee, administrator, guardian, or person holding a valid power of attorney in accordance\n\t\t\t\t\twith the probate process or otherwise in accordance with Applicable Law and has received advice of its legal\n\t\t\t\t\tcounsel to transfer such Custodial Property (which costs will be borne by Account Holder). In the event that\n\t\t\t\t\tno beneficiaries claim this Account, then the assets may be preserved in the Account for so long as possible,\n\t\t\t\t\tuntil a beneficiary makes itself known or until the Custodial Property may be subject to escheat, as set forth\n\t\t\t\t\tin <u>Section 10.5(c)</u> below.\n\t\t\t\t\t<br><br>\n\t\t\t\t\t(c) Escheat. Account Holder acknowledges that, in accordance with Applicable Law, Custodial Property that\n\t\t\t\t\tis presumed abandoned, including following termination of this Agreement, may under certain circumstances\n\t\t\t\t\tescheat to the government of the applicable jurisdiction. Prime Trust will have no liability to Account Holder,\n\t\t\t\t\tits heirs, legal representatives, or successors and assigns, or any other person in connection with any\n\t\t\t\t\tCustodial Property that escheats by operation of law.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n<br>\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>11. TAXES</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>11.1 Responsibility for Taxes</b>. Account Holder will be liable for all and any taxes, assessments, duties, and\n\t\t\t\t\tother governmental and similar charges ("Taxes") relating to any Custodial Property held on behalf of\n\t\t\t\t\tAccount Holder or any transaction related thereto, which are Account Holder\'s sole obligation to remit,\n\t\t\t\t\tunless otherwise mandated by Applicable Law. Account Holder will remit to Prime Trust the amount of any\n\t\t\t\t\tTax that Prime Trust is required by Applicable Laws (whether by assessment or otherwise) to pay on behalf\n\t\t\t\t\tof Account Holder, or in respect of activity in the Account of Account Holder. In the event that Prime Trust\n\t\t\t\t\tis required by Applicable Law to pay any Tax on behalf of Account Holder, Account Holder will promptly\n\t\t\t\t\ttransfer to Prime Trust the amount necessary to pay the Tax.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>11.2 Substitute Internal Revenue Service of the U.S. Department of the Treasury ("IRS") Form W-9</b>.\n\t\t\t\t\tUnder penalties of perjury, Account Holder certifies that: (a) the tax identification number provided to Prime\n\t\t\t\t\tTrust by Account Holder is the correct and current taxpayer identification number for Account Holder; and\n\t\t\t\t\t(b) Account Holder is not subject to backup withholding because: (i) Account Holder is exempt from backup\n\t\t\t\t\twithholding; or (ii) Account Holder has not been notified by the IRS that it is subject to backup withholding.\n\t\t\t\t\tAccount Holder agrees to immediately inform Prime Trust in writing if it has been, or at any time in the\n\t\t\t\t\tfuture is notified by the IRS that Account Holder is subject to backup withholding. Account Holder\n\t\t\t\t\tacknowledges that failing to provide accurate information may result in civil penalties.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n<br>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>12. DISCLAIMERS</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>12.1</b>. ACCOUNT HOLDER\'S ACCESS TO AND USE OF THE SERVICES ARE AT ACCOUNT\n\t\t\t\t\tHOLDER\'S OWN RISK. THE SERVICES ARE PROVIDED "AS IS" AND "AS AVAILABLE,"\n\t\t\t\t\tWITHOUT WARRANTY OF ANY KIND, EITHER EXPRESS OR IMPLIED. WITHOUT LIMITING\n\t\t\t\t\tTHE GENERALITY OF THE FOREGOING, PRIME TRUST EXPLICITLY DISCLAIMS ANY\n\t\t\t\t\tWARRAN