BILITY OF\n\t\t\t\t\tTHE INTERNET, EQUIPMENT FAILURE, WAR, TERRORIST ACTS, EMERGENCY CONDITIONS OR\n\t\t\t\t\tOTHER CIRCUMSTANCES BEYOND THE INDEMNITEE\'S CONTROL. THESE TERMS SHALL\n\t\t\t\t\tSURVIVE ANY TERMINATION OF THIS AGREEMENT.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>13.2 Cap on Liability</b>. TO THE EXTENT PERMITTED BY APPLICABLE LAW, ACCOUNT HOLDER\n\t\t\t\t\tHEREBY ACKNOWLEDGES AND AGREES UNDER NO CIRCUMSTANCES WILL INDEMNITEES\'\n\t\t\t\t\tTOTAL LIABILITY OF ANY AND ALL KINDS ARISING OUT OF OR RELATED TO THIS\n\t\t\t\t\tAGREEMENT (INCLUDING WARRANTY CLAIMS), REGARDLESS OF THE FORM AND\n\t\t\t\t\tREGARDLESS OF WHETHER ANY ACTION OR CLAIM IS BASED ON CONTRACT, TORT,\n\t\t\t\t\tNEGLIGENCE OR OTHERWISE, EXCEED THE GREATER OF $500.00 OR THE TOTAL AMOUNT OF\n\t\t\t\t\tFEES PAID, IF ANY, BY ACCOUNT HOLDER TO PRIME TRUST IN ACCORDANCE WITH THIS\n\t\t\t\t\tAGREEMENT DURING THE 12-MONTH PERIOD PRIOR TO THE OCCURRENCE OF THE EVENT\n\t\t\t\t\tGIVING RISE TO SUCH LIABILITY.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>13.3 Indemnification</b>. Account Holder hereby agrees to indemnify, protect, defend, and hold harmless the\n\t\t\t\t\tIndemnitees from and against any and all claims, demands, obligations, losses, liabilities, damages,\n\t\t\t\t\tregulatory investigations, recoveries and deficiencies (including interest, penalties and attorneys\' fees, costs,\n\t\t\t\t\tand expenses), which an Indemnitee may suffer arising out of or relating to: (i) this Agreement; (ii) any\n\t\t\t\t\tbreach, action, or regulatory investigation arising from your failure to comply with Applicable Law and/or\n\t\t\t\t\tarising out of any alleged misrepresentation, misstatement, omission of fact, or inaccuracy in the\n\t\t\t\t\trepresentations and warranties and/or in your interactions with Prime Trust, or breach, non-fulfillment or\n\t\t\t\t\tdefault in the performance of any of the conditions, covenants and agreements, of Account Holder contained\n\t\t\t\t\tin this Agreement or in any certificate or document delivered by Account Holder or any Authorized\n\t\t\t\t\tPerson(s) or other agent(s) or in any Authorized Instruction in accordance with any of the provisions of this\n\t\t\t\t\tAgreement; (iii) any breach, action or regulatory investigation arising from Account Holder\'s failure to\n\t\t\t\t\tcomply with any state blue sky laws or other applicable securities laws, and/or arising out of any alleged\n\t\t\t\t\tmisrepresentations, misstatements or omissions of material fact in the Account Holders\' offering\n\t\t\t\t\tmemoranda, general solicitation, advertisements and/or other offering documents; (iv) any obligation which\n\t\t\t\t\tis expressly the responsibility of Account Holder in accordance with this Agreement; (v) any loss or damage\n\t\t\t\t\tto any third party, direct or consequential, arising out of or in any way related to acts or omissions of any\n\t\t\t\t\tIndemnitee relating to the Services; (vi) any damages or claims resulting from equipment, software, or\n\t\t\t\t\tnetwork malfunctions or interruptions outside of any Indemnitee\'s control; or (vii) any misuse of the Services\n\t\t\t\t\tby an Authorized Person or through an Authorized Instruction.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>13.5 Third-Party Claims</b>. Account Holder agrees to bear sole 