sion of the arbitrator shall be final, binding, and enforceable in any court.\n\t\t\t\t\tFor the avoidance of doubt, Account Holder hereby waives any right to trial by jury in any lawsuit, action,\n\t\t\t\t\tproceeding, or counterclaim arising out of this Agreement. Account Holder agrees that it will not bring or\n\t\t\t\t\tparticipate in any putative or certified class action.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n<br>\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>15. GENERAL PROVISIONS</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.1 No Third-Party Beneficiaries</b>. This Agreement is not intended to and will not be construed to give\n\t\t\t\t\tany third party, including, for the avoidance of doubt, any Authorized Integrator or Service Provider, any\n\t\t\t\t\tinterest or rights (including any third-party beneficiary rights) with respect to or in connection with any\n\t\t\t\t\tagreement or provision contained herein or contemplated hereby, except as otherwise expressly provided in\n\t\t\t\t\tthis Agreement.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.2 Force Majeure</b>. Prime Trust will not be liable to any extent to Account Holder, including for any\n\t\t\t\t\tcosts or expenses, for any failure to perform or delay in the performance by Prime Trust or any Service\n\t\t\t\t\tProvider, in each case, of its obligations under this Agreement to the extent such failure or delay is caused by\n\t\t\t\t\tor results from a Force Majeure Event. For the purposes of this Agreement, a <b>"Force Majeure Event"</b> means\n\t\t\t\t\tan event caused by a circumstance beyond Prime Trust\'s reasonable control, including natural catastrophes,\n\t\t\t\t\tfire, flood, earthquake, explosion, pandemic or local epidemic, war, hostilities, or other action by a state\n\t\t\t\t\tactor, public power outages, civil unrests and conflicts, labor strikes or extreme shortages, acts of terrorism\n\t\t\t\t\tor espionage, supply shortages, interruptions or delays in transportation or communications, Domain Name\n\t\t\t\t\tServer issues outside Prime Trust\'s direct control, technology attacks, cyberattack or malfunction on the\n\t\t\t\t\tBlockchain network or protocol, or governmental action rendering performance illegal or impossible.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.3 Notices</b>\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t(a) All notices required or permitted in accordance with this Agreement will be in writing and delivered by\n\t\t\t\t\tcourier or electronic mail (except for service of legal process, which will be by courier). Any notice or other\n\t\t\t\t\tcommunications Prime Trust sends in accordance with this <u>Section 15.3</u> will be deemed to have been\n\t\t\t\t\tdelivered, whether you actually receive them or not: (i) if sent by email or any other SMTP delivery service\n\t\t\t\t