s or oral agreements\n\t\t\t\t\tbetween the Parties.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.6 Amendments</b>. This Agreement may be amended or otherwise modified by Prime Trust in its sole\n\t\t\t\t\tdiscretion at any time. Such amendments or modifications will be effective thirty (30) days after Account\n\t\t\t\t\tHolder receives notice of such revision electronically via the email address for the Account shown on the\n\t\t\t\t\trecords of Prime Trust.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.7 Remedies Cumulative</b>. Prime Trust will have all of the rights and remedies provided by Applicable\n\t\t\t\t\tLaw in addition to the rights and remedies set forth in this Agreement. All of Prime Trust\'s rights and\n\t\t\t\t\tremedies are cumulative and may be exercised from time to time, and the pursuit of one right or remedy will\n\t\t\t\t\tnot constitute an exclusive election or otherwise preclude or limit its pursuit of any other or additional right\n\t\t\t\t\tor remedy.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.8 Severability</b>. Any provision of this Agreement that is determined by competent authority to be\n\t\t\t\t\tprohibited or unenforceable in any jurisdiction shall, as to such jurisdiction, be ineffective to the extent of\n\t\t\t\t\tsuch prohibition or unenforceability without invalidating the remaining provisions hereof, and any such\n\t\t\t\t\tprohibition or unenforceability in any jurisdiction shall not invalidate or render unenforceable such provision\n\t\t\t\t\tin any other jurisdiction. In such case, such provision will be interpreted to accomplish the objectives of the\n\t\t\t\t\tprovision to the greatest extent possible under Applicable Law.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.9 Assignment</b>. Account Holder may not assign, or otherwise transfer, including by operation of law, any\n\t\t\t\t\tof its rights, obligations, or performance under this Agreement. Any such attempted transfer by Account\n\t\t\t\t\tHolder will be void. For the avoidance of doubt, Prime Trust may assign, hypothecate, or otherwise transfer,\n\t\t\t\t\tincluding by operation of law, any of its rights, obligations, or performance under this Agreement at any time\n\t\t\t\t\twithout notice to Account Holder.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.10 Use of Affiliates and Service Providers</b>. Prime Trust may provide Services through any affiliate or\n\t\t\t\t\tService Provider as directed by Prime Trust from time to time.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.11 No Waiver of Contractual Right</b>. The failure of Prime Trust to enforce any provision of this\n\t\t\t\t\tAgreement will not be construed as a waiver or limitation of Prime Trust\'s right to subsequently enforce and\n\t\t\t\t\tcompel strict compliance with every provision of this Agreement. A waiver or consent given on one occasion\n\t\t\t\t\tis effective only in that instance and will not be construed as a bar to or waiver of any other right on any\n\t\t\t\t\tother occasion.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.12 Non-Exclusivity</b>. Nothing in this Agreement will limit or restrict Prime Trust from providing\n\t\t\t\t\tservices to any other person, including any services that are similar or identical to some or all of the Services.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.13 Governing Law</b>. This Agreement is governed by, and construed exclusively in accordance with, the\n\t\t\t\t\tlaws of the State of Nevada, without regard to its conflicts of laws provisions or rules.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.14 Survival</b>. Any expiration or termination of this Agreement will not affect any accrued claims, rights\n\t\t\t\t\tor liabilities of Prime Trust, and all provisions which must survive to fulfill their intended purposes, or by\n\t\t\t\t\ttheir nature are intended to survive such expiration or termination will survive,