 The decision of the arbitrator shall be final, binding, and enforceable in any court.\n\t\t\t\t\tFor the avoidance of doubt, Account Holder hereby waives any right to trial by jury in any lawsuit, action,\n\t\t\t\t\tproceeding, or counterclaim arising out of this Agreement. Account Holder agrees that it will not bring or\n\t\t\t\t\tparticipate in any putative or certified class action.\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n<br>\n\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><b><span style=\'font-size:\n11.0pt;font-family:"Cambria",serif\'>15. GENERAL PROVISIONS</span></b><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.1 No Third-Party Beneficiaries</b>. This Agreement is not intended to and will not be construed to give\n\t\t\t\t\tany third party, including, for the avoidance of doubt, any Authorized Integrator or Service Provider, any\n\t\t\t\t\tinterest or rights (including any third-party beneficiary rights) with respect to or in connection with any\n\t\t\t\t\tagreement or provision contained herein or contemplated hereby, except as otherwise expressly provided in\n\t\t\t\t\tthis Agreement.\n\n\t\t\t\t\t</span></span><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t</span></p>\n\n\t\t\t<p class="BasicParagraph" style="line-height:normal"><span class="FormCopy"><span style=\'font-size:11.0pt;font-family:"Cambria",serif\'><br>\n\t\t\t\t\t<b>15.2 Force Majeure</b>. Prime Trust will not be liable to any extent to Account Holder, including for any\n\t\t\t\t\tcosts or expenses, for any failure to perform or delay in the performance by Prime Trust or any